// hexMustDecode converts a hex string to bytes, panicking on error
func hexMustDecode(s string) []byte {
	b, err := hex.DecodeString(s)
	if err != nil {
		panic(err)
	}
	return b
}

// FindMatchingCommand finds a command that matches the given hex data

// GetCommandDetails returns detailed information about a command given its name
func GetCommandDetails(commandName string) (DM32UVCommand, bool) {
	cmd, exists := DM32UVCommands[commandName]
	if exists {
		return cmd, true
	}
	
	// Handle generic write commands that may not be in the map
	if strings.HasPrefix(commandName, "Write Command") {
		return DM32UVCommand{
			Description: "Generic write command to radio",
			CommandHex:  "", // We don't know the exact hex here
			Format:      "57 [subcommand] [data...]",
			Parameters:  "subcommand: command identifier, data: command parameters",
		}, true
	}
	
	return DM32UVCommand{}, false
}
func FindMatchingCommand(data []byte) (string, bool) {
	hexStr := hex.EncodeToString(data)
	for name, cmd := range DM32UVCommands {
		if cmd.CommandHex == hexStr {
			return name, true
		}
	}
	return "", false
}
